={
    "model": "gpt-4.1",
    "messages": [
        {
            "role": "system",
            "content": "Based on the user request, generate a valid Chart.js definition. Important: - Be careful with the data scale and ensure that all data are visible. For example, if plotting data 2 and 3 on a bar chart, the baseline should be 0. - Charts colors should be different only if there are multiple datasets. - The output should be a valid JSON structure starting with {'chart':. Ensure that the structure matches this example: `{'chart': {'type': 'bar', 'data': {'labels': ['Hello', 'World'], 'datasets': [{'label': 'Foo', 'data': [1, 2]}]}}}`. In scales, min and max are numbers. Example: `{scales:{yAxes:[{ticks:{min:0,max:3}`"
        },
        {
            "role": "user",
            "content": "input_data {{ $json.input_data.replaceAll('"','') }} | chart_query : {{ $json.chart_query }}"
        }
    ],
    "response_format": {
  "type": "json_schema",
  "json_schema": {
    "name": "chart_configuration",
    "description": "Configuration schema for Chart.js charts",
    "strict": true,
    "schema": {
  "type": "object",
  "properties": {
    "chart": {
      "type": "object",
      "properties": {
        "type": {
          "type": "string",
          "enum": ["bar", "line", "radar", "pie", "doughnut", "polarArea", "bubble", "scatter", "area"]
        },
        "data": {
          "type": "object",
          "properties": {
            "labels": {
              "type": "array",
              "items": {
                "type": "string"
              }
            },
            "datasets": {
              "type": "array",
              "items": {
                "type": "object",
                "properties": {
                  "label": {
                    "type": ["string", "null"]
                  },
                  "data": {
                    "type": "array",
                    "items": {
                      "type": "number"
                    }
                  },
                  "backgroundColor": {
                    "type": ["array", "null"],
                    "items": {
                      "type": "string"
                    }
                  },
                  "borderColor": {
                    "type": ["array", "null"],
                    "items": {
                      "type": "string"
                    }
                  },
                  "borderWidth": {
                    "type": ["number", "null"]
                  }
                },
                "required": ["data", "label", "backgroundColor", "borderColor", "borderWidth"],
                "additionalProperties": false
              }
            }
          },
          "required": ["labels", "datasets"],
          "additionalProperties": false
        }
      },
      "required": ["type", "data"],
      "additionalProperties": false
    },
    "options": {
      "type": "object",
      "properties": {
        "scales": {
          "type": ["object", "null"],
          "properties": {
            "yAxes": {
              "type": "array",
              "items": {
                "type": ["object", "null"],
                "properties": {
                  "ticks": {
                    "type": ["object", "null"],
                    "properties": {
                      "max": {
                        "type": ["number", "null"]
                      },
                      "min": {
                        "type": ["number", "null"]
                      },
                      "stepSize": {
                        "type": ["number", "null"]
                      },
                      "beginAtZero": {
                        "type": ["boolean", "null"]
                      }
                    },
                    "required": ["max", "min", "stepSize", "beginAtZero"],
                    "additionalProperties": false
                  },
                  "stacked": {
                    "type": ["boolean", "null"]
                  }
                },
                "required": ["ticks", "stacked"],
                "additionalProperties": false
              }},
              "xAxes": {
                "type": ["object", "null"],
                "properties": {
                  "stacked": {
                    "type": ["boolean", "null"]
                  }
                },
                "required": ["stacked"],
                "additionalProperties": false
              }
          },
          "required": ["yAxes", "xAxes"],
          "additionalProperties": false
        },
        "plugins": {
          "type": ["object", "null"],
          "properties": {
            "title": {
              "type": ["object", "null"],
              "properties": {
                "display": {
                  "type": ["boolean", "null"]
                },
                "text": {
                  "type": ["string", "null"]
                }
              },
              "required": ["display", "text"],
              "additionalProperties": false
            },
            "legend": {
              "type": ["object", "null"],
              "properties": {
                "display": {
                  "type": ["boolean", "null"]
                },
                "position": {
                  "type": ["string", "null"],
                  "enum": ["top", "left", "bottom", "right", null]
                }
              },
              "required": ["display", "position"],
              "additionalProperties": false
            }
          },
          "required": ["title", "legend"],
          "additionalProperties": false
        }
      },
      "required": ["scales", "plugins"],
      "additionalProperties": false
    }
  },
  "required": ["chart", "options"],
  "additionalProperties": false
}
}
}
}

options.systemMessage:
=너는 데이터분석 전문가다.

입력 데이터에는 병원이름(dutyName), 응급실 수(hvec), 기록날짜(hvidate)가 포함된다.  
너의 임무는 아래와 같다:

1. EDA(탐색적 데이터 분석)를 수행해라.
   • 응급실 수가 가장 부족한 시간대 식별  
   • 병원별 평균 응급실 수 산출  
   • 기타 유의미한 통계량 도출  

2. 보고서 작성  
   • 분석 결과를 바탕으로 현실적으로 응급실 수를 개선할 수 있는 방안을 제안한다.  
   • 결과는 최대 2000글자를 넘지 않도록 한다.  

3. 차트 생성  
   • "Generate a chart" 도구를 사용하여 데이터차트를 생성한다.  
   • 예시
     - input_data : [유저입력데이터]
     - chart_query : "병원별 평균 응급실 수를 산출해 주세요."

4. 출력 형식  
   결과는 반드시 Slack Block Kit JSON 구조를 따라야 하며, { "blocks": 로 시작해야 한다.  
   Block Kit에는 오직 순수 JSON만 넣는다. (백틱, json 라벨, 주석, 트레일링 콤마 전부 금지)

아래 구조를 반드시 포함해야 한다:

{
	"blocks": [
		{
			"type": "header",
			"text": {
				"type": "plain_text",
				"text": "📊 응급실 가용성 데이터 분석 리포트",
				"emoji": true
			}
		},
		{
			"type": "context",
			"elements": [
				{
					"type": "mrkdwn",
					"text": "작성자: 데이터팝콘 | 역할: 데이터 분석 전문가"
				}
			]
		},
		{
			"type": "divider"
		},
		{
			"type": "section",
			"text": {
				"type": "mrkdwn",
				"text": "*1. 주요 분석 결과* \n- 시간대별 응급실 수 분포 분석\n- 병원별 평균 응급실 가용 현황\n- 부족 시간대 및 패턴 도출"
			}
		},
		{
			"type": "section",
			"text": {
				"type": "mrkdwn",
				"text": "*2. 시각화 자료* \n아래 링크를 클릭하면 상세 차트를 확인할 수 있습니다.\n<https://quickchart.io/chart?~|📈 응급실 가용성 차트>"
			}
		},
		{
			"type": "divider"
		},
		{
			"type": "section",
			"text": {
				"type": "mrkdwn",
				"text": "*3. 개선 제안* \n- 인력 재배치 및 교대 근무 최적화\n- 병원 간 응급실 자원 공유 협력\n- 실시간 모니터링 시스템 강화"
			}
		},
		{
			"type": "context",
			"elements": [
				{
					"type": "mrkdwn",
					"text": "※ 본 보고서는 입력된 데이터(병원이름, 응급실 수, 기록날짜)를 기반으로 작성되었습니다."
				}
			]
		}
	]
}
